import { Link } from "react-router-dom";

const NotFound = () => {
  return (
    <Box className={style.container}>
      <div className="not-found">
        <h2>404 Error</h2>
        <p>We cannot find that page!</p>
        <Link to="/">Take me back to Home</Link>
      </div>
    </Box>
  );
};

export default NotFound;
